import "./Header.css";
import React from "react";
import Logo from "../../Images/techGeekLogo.svg";

function Header() {
  return (
    <header className="header__container">
      <div className="header__contents">
        <a href="#default" className="header__logo">
          <img
            src={Logo}
            alt="logo"
            width={300}
            height={100}
            className="company__logo"
          />
        </a>
        <div className="header-right">
          <a className="header__tab home__tab active" href="#home">
            Home
          </a>
          <a className="header__tab mentors__tab " href="#contact">

          </a>
          <a className="header__tab testimonial__tab " href="#about">
            Testimonial
          </a>
          <a className="header__tab contact__tab " href="#about">
            Contact
          </a>
          <a className="header__tab login__tab " href="#about">
            Login
          </a>
          <a className="header__tab signup__tab " href="#about">
            Sign Up
          </a>
        </div>
      </div>
    </header>
  );
}

export default Header;
